import React from "react";

const App = () => {
  let stringOne = " Bonjour messiuer ";
  const div = document.querySelector("div");
  window.onclick = () => {
    localStorage.setItem("myString", stringOne);
    div.textContent = localStorage.getItem("myString");
  };

  console.log(stringOne.trimStart());
  return <div>Hello</div>;
};

export default App;
